import React from 'react'
import './About.css'
import { Row, Col, Container } from 'reactstrap'
import logo  from '../res/saaranglogo/logo.png';
import tv  from '../res/saaranglogo/television.svg';
import bg from '../res/saaranglogo/bg2.jpg'

class AboutComponent extends React.Component {
  render() {
    return <div style={{backgroundImage: `url(${bg})`}}>

      <img src= {logo} alt= "saarang_logo" height= "65%" width= "65%"/>
      <img src= {tv}  />

    </div>
  }
}

export default AboutComponent
